(22, 'Laiza Gomes', 'financeiro@orion.com.br', 'Orçamento para melhoria ou criação de um novo site', 'Boa tarde!!\r\nQueria um orçamento para criação do nosso site. \r\n▪ Layout exclusivo e personalizado, com sistema para inserção de banners com efeitos de transição\r\n(Obs.:*neste pacote será oferecido um banner incluso no layout. O desenvolvimento de arte para novos banners\r\npoderá ser contratado, opcionalmente, à parte); ▪ Sistema dinâmico e responsivo para smartphones, tablets e desktops;\r\n▪ Páginas possíveis: ex. home; quem somos/empresa; produtos; serviços; contato; suporte premium.\r\n▪ Sessões possíveis: ex. newsletter; infraestrutura; nossa equipe; depoimentos; clientes; blog. \r\n▪ Funções: integração com redes sociais (ex. Facebook, Instagram e chat do Whatsapp); \r\n▪ Site desenvolvido com SEO estrutural, que contribui para a otimização em mecanismos de busca\r\n(como Google); \r\n▪ Site totalmente gerenciável pelo cliente, com painel de controle que dá autonomia para a inserção,\r\nedição e remoção de conteúdo, controles de usuários, etc.; \r\n▪ Treinamento gratuito para inserir, editar e remover conteúdo do site\r\n', '2021-03-17'),
(23, 'Aline ', 'alinewaichert@gmail.com', 'Orçamento ', 'Boa noite, gostaria de orçamento de site p minha empresa . Obrigada ', '2021-05-13'),
(24, 'Fabio Campos', 'fabio@campuz.com.br', 'Proposta para montar site', 'Gostaria de uma proposta para um site, institucional, simples para a minha empresa.', '2021-09-28');
INSERT INTO `duvidas` (`id_duvida`, `pergunta`, `resposta`, `data`) VALUES
(2, 'Por que eu preciso de uma hospdagem?', '<p>A hospedagem &eacute; um servidor onde os <strong>arquivos do seu site</strong> ficam armazanados para serem <strong>acessados via web</strong>.</p>\r\n\r\n<p>No mesmo&nbsp;armazanamento s&atilde;o guardadas&nbsp;informa&ccedil;&otilde;es de registros de <strong>banco de dados</strong> e <strong>e-mails profissionais</strong> da sua conta vinculada.</p>\r\n', '2019-07-26'),
(3, 'Por que eu preciso de um domínio?', '<p><strong>Dom&iacute;nio </strong>&eacute; o nome escolhido para o seu <strong>site </strong>e que <strong>ajuda </strong>o seu cliente a <strong>encontr&aacute;-lo</strong> na internet. Por exemplo:</p>\r\n\r\n<p>www.<strong>suaempresa.com.br</strong></p>\r\n', '2019-07-26'),
(4, 'O que é conta de E-mail Profissional?', '<p>&Eacute; um e-mail <strong>personalizado </strong>com o mesmo <strong>nome de&nbsp;dom&iacute;nio</strong> do seu site. Podemos personalizar um ou v&aacute;rios <strong>e-mails profissionais</strong> conforme a necessidade e a demanda de uso por usu&aacute;rios.</p>\r\n\r\n<p><strong>Exemplo:</strong> contato@suaempresa.com.br&nbsp;</p>\r\n', '2019-09-04'),
(5, 'Como é estipulado o prazo de entrega?', '<p>O <strong>prazo de entrega</strong> &eacute; estipulado depois da conversa com o cliente e levantamento de recursos do futuro projeto. A parti da&iacute; analisamos os recursos de programa&ccedil;&atilde;o e estiliza&ccedil;&atilde;o de telas e informamos o prazo de entrega.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2020-03-07'),
(6, 'Qual valor cobrado para desenvolver um site ou sistema web?', '<p>O <strong>valor </strong>&eacute; estipulado ap&oacute;s a conversa com o cliente e levantamento de recursos para o futuro projeto. N&atilde;o h&aacute; um valor fixo pois cada cliente tem uma necessidade diferente.</p>\r\n', '2020-03-07'),
(7, 'Quais tecnologias de programação vocês trabalham?', '<p>A <strong>Ale Evolu&ccedil;&otilde;es</strong> trabalha com as seguintes Tecnologias:</p>\r\n\r\n<p><strong>HTML 5, CSS 3, javascript, EcmaScript, Sass, Git, PHP (OO), MySql.</strong></p>\r\n', '2020-03-07');
INSERT INTO `evolucoes` (`id_evolucao`, `id_arquivo`, `id_categoria`, `nome_projeto`, `slug`, `descricao`) VALUES
(11, 148, 7, 'Blog Pessoal', 'blog-pessoal', '<p>Blog simples e equilibrado com postagens do jornalista.</p>\r\n\r\n<p><strong>Tecnologias usadas:</strong></p>\r\n\r\n<ul>\r\n	<li>HTML 5</li>\r\n	<li>CSS3</li>\r\n	<li>Javascript</li>\r\n	<li>PHP</li>\r\n	<li>MySQL</li>\r\n</ul>\r\n'),
(12, 149, 6, 'Painel AleEvolucoes', 'painel-aleevolucoes', '<p>Sistema de Gerenciamento de clientes, servi&ccedil;os e financeiro da <strong><a href=\"https://aleevolucoes.com.br/\">Ale Evolu&ccedil;&otilde;es</a>. </strong>Com design estilizado com Materialize.</p>\r\n\r\n<p><strong>Tecnologias usadas:</strong></p>\r\n\r\n<ul>\r\n	<li>HTML5</li>\r\n	<li>CSS3</li>\r\n	<li>JavaScript</li>\r\n	<li>Jquery</li>\r\n	<li>EcmaScript</li>\r\n	<li>PHP (Estrututura&nbsp;MVC - Orientada a Objeto)</li>\r\n	<li>Mysql</li>\r\n</ul>\r\n'),
(13, 150, 6, 'Painel CMS', 'painel-cms', '<p>Um painel para gerenciamento de conte&uacute;do do site <a href=\"http://ipanemaembalagens.com.br/\">Ipanema Embalegens</a>. Neste sistema intuitivo podemos cadastrar as fotos das embalagens e criar categorias conforme a demanda.</p>\r\n\r\n<p><strong>Tecnologias usadas:</strong></p>\r\n\r\n<ul>\r\n	<li>HTML5</li>\r\n	<li>CSS3</li>\r\n	<li>JavaScript</li>\r\n	<li>PHP</li>\r\n	<li>Mysql</li>\r\n</ul>\r\n'),
(14, 151, 6, 'Sistema para Plano de Saúde', 'sistema-para-plano-de-saude', '<p>Esse sistema foi desenvolvido&nbsp;para Safe Corretora, uma empresa de Seguros em v&aacute;rias &aacute;rea. Podemos gerenciar o cadastro de titulares e dependentes, Cadastro de correto e co-corretor, comiss&otilde;es, planos, Financeiro e usu&aacute;rios do sistema.</p>\r\n\r\n<p>Nos planos podemos cadastrar a corretora e as faixa et&aacute;rias por plano. Ao cadastrar um titular e/ou dependente o sistema calcula pela data de nascimento a idade e retorna o valor do plano.</p>\r\n\r\n<p><strong>Tecnologias usadas:</strong></p>\r\n\r\n<ul>\r\n	<li>HTML5</li>\r\n	<li>CSS3</li>\r\n	<li>javascript</li>\r\n	<li>jquery</li>\r\n	<li>PHP</li>\r\n	<li>Mysql</li>\r\n</ul>\r\n'),
(15, 152, 1, 'Ipanema Embalagens', 'ipanema-embalagens', '<p>&Eacute; um site Institucional apresentando a empresa, e apresenta&ccedil;&atilde;o de seus produtos.</p>\r\n\r\n<p>Este projeto &eacute; responsivo, &eacute; compat&iacute;vel com tablet e celulares.</p>\r\n\r\n<p><strong>Tecnologias usadas:</strong></p>\r\n\r\n<ul>\r\n	<li>HTML5</li>\r\n	<li>CSS3</li>\r\n	<li>Javascript</li>\r\n	<li>PHP</li>\r\n</ul>\r\n'),
(16, 153, 1, 'ImpactusBeneficios.com.br', 'impactusbeneficios.com.br', '<p>Site desenvolvido pra Impactus Benef&iacute;cios. &Eacute; simples,&nbsp;&nbsp;amig&aacute;vel e Intuitivo. Compat&iacute;vel com tablets e celulares com design leve e limpo.</p>\r\n\r\n<p><strong>Tecnologias usadas:</strong></p>\r\n\r\n<ul>\r\n	<li>HTML5</li>\r\n	<li>CSS3</li>\r\n	<li>javascript</li>\r\n	<li>jquery</li>\r\n	<li>EcmaScritp</li>\r\n	<li>PHP (Estrutura MVC)</li>\r\n</ul>\r\n'),
(18, 155, 6, 'Guilherme Belido', 'guilherme-belido', '<p>&Eacute; um CMS para gerencimanto de post do site Guilherme Belido que se encontra em nosso portf&oacute;lio. Neste existe diverso tipos de posts para o usu&aacute;rio gerenciar a sua demanda.</p>\r\n\r\n<p><strong>Tecnologias usadas:</strong></p>\r\n\r\n<ul>\r\n	<li>HTML5</li>\r\n	<li>CSS3</li>\r\n	<li>JavaScript</li>\r\n	<li>PHP (Estrutura MVC OO)</li>\r\n</ul>\r\n'),
(19, 156, 1, 'MA Balança', 'ma-balanca', '<p>Mais um site institucional para MA Balan&ccedil;a onde apresenta a empresa e seus servi&ccedil;os. Compat&iacute;vel com todas as telas (desktop, tablet, celulares).</p>\r\n\r\n<p>Tecnologias usadas:</p>\r\n\r\n<ul>\r\n	<li>HTML5</li>\r\n	<li>CSS3</li>\r\n	<li>PHP (Estrutura MVC OO)</li>\r\n	<li>JavaScript</li>\r\n</ul>\r\n'),
(20, 157, 1, 'FP Informática', 'fp-informatica', '<p>Tamb&eacute;m voltado para apresenta&ccedil;&atilde;o da marca e seus servi&ccedil;os. &Eacute; intuitivo, leve e simples.</p>\r\n\r\n<p><strong>Tecnologias usadas:</strong></p>\r\n\r\n<ul>\r\n	<li>HTML5</li>\r\n	<li>CSS3</li>\r\n	<li>JavaScript</li>\r\n	<li>PHP</li>\r\n</ul>\r\n'),
(21, 158, 1, 'Central Eletro', 'central-eletro', '<p><strong>Site Institucional: </strong>Tamb&eacute;m voltado para apresenta&ccedil;&atilde;o da marca e seus servi&ccedil;os. &Eacute; intuitivo, leve e simples.</p>\r\n\r\n<p><strong>Tecnologias usadas:</strong></p>\r\n\r\n<ul>\r\n	<li>HTML5</li>\r\n	<li>CSS3</li>\r\n	<li>JavaScript</li>\r\n	<li>PHP</li>\r\n</ul>\r\n'),
(22, 159, 1, 'Inovare Soluções', 'inovare-solucoes', '<p>Tamb&eacute;m voltado para apresenta&ccedil;&atilde;o da marca e seus servi&ccedil;os. &Eacute; intuitivo, leve e simples.</p>\r\n\r\n<p><strong>Tecnologias usadas:</strong></p>\r\n\r\n<ul>\r\n	<li>HTML5</li>\r\n	<li>CSS3</li>\r\n	<li>JavaScript</li>\r\n	<li>PHP</li>\r\n</ul>\r\n'),
(23, 160, 1, 'Café com foto', 'cafe-com-foto', '<p>Tamb&eacute;m voltado para apresenta&ccedil;&atilde;o da marca e seus servi&ccedil;os. &Eacute; intuitivo, leve e simples. Site com agenda de eventos do Caf&eacute; com foto.</p>\r\n\r\n<p><strong>Tecnologias usadas:</strong></p>\r\n\r\n<ul>\r\n	<li>HTML5</li>\r\n	<li>CSS3</li>\r\n	<li>JavaScript</li>\r\n	<li>PHP</li>\r\n</ul>\r\n'),
(24, 161, 1, 'Casa Certa Filtro', 'casa-certa-filtro', '<p>Para apresentar os seus produtos foi necess&aacute;rio criar o site da Casa Certa Filtros. &Eacute; site de vitrine de apresenta&ccedil;&atilde;o de seus produtos.</p>\r\n\r\n<p><strong>Tecnologias usadas:</strong></p>\r\n\r\n<ul>\r\n	<li>HTML5</li>\r\n	<li>CSS3</li>\r\n	<li>JavaScript</li>\r\n	<li>PHP</li>\r\n</ul>\r\n'),
(25, 162, 1, 'Fimag', 'fimag', '<p>Tamb&eacute;m institucional de apresenta&ccedil;&atilde;o da marca, servi&ccedil;os e produtos.</p>\r\n\r\n<p><strong>Tecnologias usadas:</strong></p>\r\n\r\n<ul>\r\n	<li>HTML5</li>\r\n	<li>CSS3</li>\r\n	<li>JavaScript</li>\r\n	<li>PHP</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n');
