(64, 'Cecil Carlisle', 'carlisle.cecil@msn.com', '0494-2168426', 'Acquiring GOV backlinks is one of the most sought-after link building strategies that’s still popular among SEO experts today.\r\n\r\nAlthough Matt Cutts (the former head of Google search quality team) has said that Google does not give any special importance to .gov domains, seasoned SEO practitioners have proven that powerful backlinks from government websites can improve your website’s overall search visibility.\r\n\r\nMore info:\r\nhttps://www.monkeydigital.io/product/gov-backlinks/\r\n\r\nthanks and regards\r\nMike\r\nmonkeydigital.co@gmail.com\r\n', '2020-01-08'),
(65, 'Douglas Vieira', 'dvmendes@gmail.com', '3534227819', 'Se você é pré-candidato a prefeito ou a vereador, jornalista, dirigente partidário ou assessor político, inscreva-se agora no Curso de Marketing Político-Eleitoral\r\n\r\nhttps://cursoeleitoral.com.br/curso/marketingpolitico/\r\n\r\nO curso é composto por vídeos aulas, apostilas e materiais de apoio quem têm como objetivo apresentar e explicar como preparar a comunicação e o marketing de uma campanha, desde o planejamento até as urnas.\r\n\r\nO curso foi elaborado e é apresentado pelo jornalista Douglas Vieira, mestre em Comunicação, assessor de comunicação na Assembleia Legislativa de Minas Gerais e com experiência em várias campanhas eleitorais.\r\n\r\n- 40 Horas de Curso\r\n- Videoaulas Dinâmicas\r\n- Apostilas em PDF\r\n- Tire dúvidas direto com o professor\r\n- Dezenas de materiais de apoio\r\n- Certificado de Conclusão\r\n- Acesso às aulas até as eleições\r\n- 100% Online!\r\n\r\n\r\n==== São 11 Unidades:\r\n- Nascimento da candidatura\r\n- Imagem do candidato\r\n- Redes Sociais\r\n- Formações da equipe de coordenação\r\n- Criação do cronograma de ações\r\n- Pesquisas de opinião\r\n- Criação do plano de mídia\r\n- Mapeamento das regiões da cidade e as personas da campanha\r\n- Media training e formatação do discurso do candidato\r\n- Preparações para reuniões, entrevistas e debates\r\n- Criação do plano de governo\r\n- Cuidados dos candidatos à reeleição\r\n- Cronograma das ações de campanha', '2020-01-09'),
